/* Above is https://unpkg.com/@otplib/preset-browser@12.0.1/index.js (Replaced window with self) */

const DaCryptoJS = getCryptoJS()

const decrypt = async (ciphertext: string, key?: string): Promise<string> => {
	if (!ciphertext) return ''
	let decryptKey = key
	if (!decryptKey) {
		const user = await getStorageItem('user')
		if (!user?.username) return ''
		const encryptedPassword = await getStorageItem('encrypted_password')
		if (!encryptedPassword) return ''
		decryptKey = await decrypt(encryptedPassword, user.username.toLowerCase())
	}
	const keyHex = DaCryptoJS.enc.Utf8.parse(decryptKey)
	const decrypted = DaCryptoJS.DES.decrypt({
		ciphertext: DaCryptoJS.enc.Base64.parse(ciphertext)
	}, keyHex, {
		mode: DaCryptoJS.mode.ECB,
		padding: DaCryptoJS.pad.Pkcs7
	})
	return decrypted.toString(DaCryptoJS.enc.Utf8)
}

/* Try and update accounts every 5 minutes */
chrome.alarms.create({ delayInMinutes: 5 })
chrome.alarms.onAlarm.addListener(() => {
	updateAccounts()
})

async function getStorageItem(key: string): Promise<any> {
	return new Promise((resolve) => {
		chrome.storage.local.get(key, (result) => {
			resolve(result?.[key] || null)
		})
	})
}

let _aliases = {}

async function onLoad() {
  /* Get aliases */
  fetch('https://noonly.net/public/aliases.json').then((res) => {
    if (!res.ok)
      throw new Error('HTTP error ' + res.status)
    return res.json()
  }).then((json) => {
    _aliases = json
    chrome.storage.local.set({ aliases: json })
  }).catch(async () => {
    // Fall back to cached version
    const aliasesData = await getStorageItem('aliases')
    if (aliasesData) _aliases = aliasesData
  })

	/* This should update the accounts immediately if they have not been updated in 7 minutes */
	const lastUpdated = await getStorageItem('lastUpdated')
	const currentTime = Math.floor(Date.now() / 1000)
	if (currentTime - lastUpdated > 7 * 60)
		updateAccounts()
}
onLoad()

async function updateAccounts() {
	const jwtToken = await getStorageItem('jwtToken')
	if (!jwtToken) return

	fetch('https://oldapi.noonly.net/accounts/fetch', {
		method: 'POST',
		headers: {
			Authorization: jwtToken
		}
	}).then((res) => res.json()).then((res) => {
		if (!res?.data?.accounts) return
		chrome.storage.local.set({ accounts: Object.values(res.data.accounts) })
		chrome.storage.local.set({ lastUpdated: Math.floor(Date.now() / 1000).toString() })
	}).catch(() => null)
}

/* Message Listener */
chrome.runtime.onMessage.addListener((request, sender, sendResponse) => {
	if (request.event === 'DECRYPT') {
		decrypt(request.payload).then((decrypted) => {
			sendResponse(decrypted)
		})
		/* Return true to keep port open */
		return true
	} else if (request.event === 'FETCH_ACCOUNTS') {
		getStorageItem('accounts').then((accounts) => {
			sendResponse(accounts)
		})
		/* Return true to keep port open */
		return true
	} else if (request.event === 'FETCH_ICON') {
			getBase64(request.payload).then((base64) => {
				sendResponse(base64)
			})
		/* Return true to keep port open */
		return true
	} else if (request.event === 'GET_MFA_CODE') {
    decrypt(request.payload).then((decrypted) => {
      // @ts-ignore
      sendResponse(self.otplib.authenticator.generate(decrypted))
    })
		/* Return true to keep port open */
    return true
  } else if (request.event === 'FETCH_ALIASES') {
    sendResponse(_aliases)
    /* Return true to keep port open */
    return true
  }
})

function getBase64(url: string) {
	return new Promise((resolve) => {
		fetch(url).then((data) => data.blob()).then((blob) => {
			const reader = new FileReader()
			reader.readAsDataURL(blob)
			reader.onloadend = () => resolve(reader.result || null)
			reader.onerror = () => resolve(null)
		}).catch((err) => resolve(null))
	})
}